import React from 'react';
import { Switch, Route  } from 'react-router-dom';
import Header from './components/Header';
import DataTable from './components/DataTable';

const App = () => {
  return (
    <div>
      <Header />
      <Routes>
        <Route exact path="/" component={DataTable} />
      </Routes>
    </div>
  );
};

export default App;
